import styled from 'styled-components';

const DeleteFromCartButton = styled.button`
  background: black;
  color: white;
  font-size: 3rem;
  border: 0;
  position: absolute;
  z-index: 2;
  right: 0;
`;

export default DeleteFromCartButton;
